import React from 'react';
import './PumpkinPlot.css';

const PumpkinPlot = ({pumpkin}) => {
  return (
    <div className="pumpkin-plot">
      {pumpkin && <img src={require(pumpkin.src)} alt={pumpkin.title}/>}
    </div>
  );
}

export default PumpkinPlot;
